import { useEffect, useState } from "react";

const Home = () => {
    let[product,setProduct]=useState()
    useEffect(()=>{
        let fetchData=async()=>{
            let response=await fetch("https://dummyjson.com/products")
            let data= await response.json()
            setProduct(data)
        }
        fetchData()
    },[])
    return ( 
        <div className="home">
           {product.map(prod=>(
            <div className="products">
                <h1>{prod.title}</h1>
            </div>
           ))}
        </div>
     );
}
 
export default Home;
